import React from 'react';
//import { Route, Switch, useHistory } from 'react-router';

function App() {
  //const history = useHistory();

  return (
    <>
      <div>
        <h1>Chat App</h1>
        < Chat />
    </div>
      
    </>
    
  );
}

export default App;

